</template>

<script setup>
import { ref, onMounted } from 'vue';
import { useQuasar } from 'quasar';
import { getLocaleCalendario } from 'src/utils/CalendarUtils';
import { fetchConsultas } from 'src/services/ConsultaService';

const localeData = getLocaleCalendario('pt');

const $q = useQuasar();

const consultas = ref([]);

const dateNow = ref('31/08/2024');

const columns = [
  { name: 'paciente', label: 'Paciente', align: 'left', field: 'paciente' },
  { name: 'data', label: 'Data', align: 'left', field: 'data' },
  { name: 'hora', label: 'Hora', align: 'left', field: 'hora' },
  { name: 'anotacoesPsicologo', label: 'Anotações do Psicólogo', align: 'left', field: 'anotacoesPsicologo' },
  { name: 'linkMeet', label: 'Link Meet', align: 'left', field: 'linkMeet' },
];

const loadConsultas = async () => {
  try {
    const data = await fetchConsultas();
    consultas.value = data;
  } catch (error) {
    $q.notify({
      type: 'negative',
      message: error.message,
    });
  }
};

const formatDate = (date) => {
  return new Date(date).toLocaleDateString();
};

const formatTime = (time) => {
  return new Date(time).toLocaleTimeString();
};

onMounted(() => {
  loadConsultas();
});
</script>

